import Moviecard from "./Moviecard"
export const Moviecontrols = ({movie, type})=>{
    return(
        <div>
            {type === "likedlist" &&(
            <>
             <button>
                 <i className="fa-fw fa fa-times"></i>
             </button>
            </>
            )}
        </div>
    );
};
